export const getSeperatedArraysWithUniqueValues = () => {
  const block = new Set();
  const district = new Set();
  const cluster = new Set();
  location_data.forEach((item) => {
    block.add({ id: item.id, name: item.block });
    district.add({ id: item.id, name: item.district });
    cluster.add({ id: item.id, name: item.cluster });
  });
  return {
    block: Array.from(block),
    district: Array.from(district),
    cluster: Array.from(cluster),
  };
};
